        skeletonAdapter->RegisterMethod(&DevmNodeServiceInterfaceSkeleton::SetConfig, *this, methods::SetConfigId);
        skeletonAdapter->RegisterMethod(&DevmNodeServiceInterfaceSkeleton::SetMasterMode, *this, methods::SetMasterModeId);
